 * {
 --hat-base: #FF506E;
 --hat-accent: #FFFFFF;
 --medallion-base: #FFFFFF;
 --collar-base: #FF506E;
 --cape-base: #FFFF FF;
 --pants-base: #FF506E;
 --boot-accent: #FF4848;
 --boot-base: #FFFFFF;
 --hands-base: #FFFFFF;
 --hands-accent: #FF506E;
 --wand-accent: #FF4848;
}

 /* L02 Legs/Pants */
#legs #base {
 fill: var(--pants-base);
}

/* L03 Boots * /
#left_boot #base, #right_boot #base-2 {
 fill: var(--boot-base);
}

#left_boot #accent, #right_boot #accent-2 {
 fill: var(--boot-accent);
}

/* L04 Hat */
#hat01 #base,
#hat02 #base,
#hat03 #base,
#hat04 #base,
#hat05 #base,
#hat06 #base,
#hat07 #base,
#hat07 #base-2,
#hat08 #base,
#hat09 #base,
#hat10 #base,
#hat11 #base,
#hat12 #base,
#hat13 #base,
#hat14 #base,
#hat14 #basic,
#hat15 #base,
#hat16 #base {
 fill: var(--hat-base);
}

#hat01 #accent,
#hat02 #accent,
#hat03 #accent,
#hat04 #a ccent,
#hat05 #accent,
#hat05 #accent-2,
#hat05 #accent-3,
#hat05 #accent-4,
#hat06 #accent,
#hat07 #accent,
#hat07 #accent-2,
#hat08 #accent,
#hat09 #accent,
#hat10 #accent,
#hat11 #accent,
#hat12 #accent,
#hat13 #accent,
#hat14 #accent,
#hat15 #accent,
 #hat16 #accent,
#hat16 #accent-2,
#hat16 #accent-3 {
 fill: var(--hat-accent);
}

/*L07 - Cape */
#medallion {
 fill: var(--medallion-base);
}

#collar {
 fill: var(--collar-base);
}

#cape {
 fill: var(--cape-base);
}

/* L08 Hands */

# down_righthand #base, #bottom_part #base, #top_part #base {
 fill: var(--hands-base);
}

#down_righthand #accent, #bottom_part #accent {
 fill: var(--hands-accent);
}

/* L09 Wands */

#wand01 #accent,
#wand02 #accent,
#wand03 #accent,
#wand04 #accent, 
#wand04 #accent-2,
#wand05 #accent,
#wand05 #accent-2,
#wand05 #accent-3,
#wand06 #accent,
#wand06 #accent-2
{
